CommentBody:
On Escalation Ticket # 00425972 the new comment has been added: Alexandra-Alina Pascalau:

Hi Emil,


We require more information in order to make a recommendation.


	 - 	Please provide some printscreens with the results of these queries:


--- CODE ---
SELECT count(1) FROM clientmachine WHERE deleted = 1;
SELECT count(1) FROM clientmachine;
SELECT count(1) FROM clientmachine  WHERE deleted = 0 and (loggeduser_id = '' or loggeduser_id IS NULL ) ;

SELECT count(1) FROM clientdevice WHERE deleted = 1;
SELECT count(1) FROM clientdevice;

SELECT count(1) FROM clientuser WHERE deleted = 1;
SELECT count(1) FROM clientuser;
SELECT count(1) FROM clientuser where deleted = 0 and (last_machine_id  IS NULL or last_machine_id = '');

SELECT count(1) FROM eppgroup WHERE deleted = 1;
SELECT count(1) FROM eppgroup;

SELECT eppgroup.id, eppgroup.name, count(machinegroup.machine_id) as machines FROM machinegroup LEFT JOIN eppgroup ON eppgroup.id = machinegroup.group_id group by eppgroup.id;

SELECT eppgroup.id, eppgroup.name, count(clientgroup.client_id) as users FROM clientgroup LEFT JOIN eppgroup ON eppgroup.id = clientgroup.group_id group by eppgroup.id;

SELECT  * FROM export_entities WHERE export_status=0G
--- CODE ---

    2. Delete all scheduled exports (they can be recreated at the end of this test)

           System Maintenance - Exported Entities ->   tab Scheduled exports

    3. Delete old exports that did not finalize:

--- CODE ---
   DELETE FROM export_entities WHERE export_status=0;
--- CODE ---

   4. Enable debugging for the export cron:


--- CODE ---
              touch /tmp/export_entities.debug
              touch /var/log/epp/export_entities.log
              chmod 777 /var/log/epp/export_entities.log
--- CODE ---

   5. Run a onetime computers export, wait 10-15 minutes and provide the debug file /var/log/epp/export_entities.log

   6. Disable the debugging:

--- CODE ---
               rm /tmp/export_entities.debug
--- CODE ---

   7. Recreate the Scheduled exports 

   8. Is there a sync job (Entra or Microsoft AD) running at this moment?

Thank you,
Alina

@WaitingOnEngineer

